import { Link } from 'react-router-dom';

function ArtImageTile({ gallery, art }) {

    return (
        // Show the image for the first piece of art, and wrap it in a Link
        <Link to={`/galleries/${gallery.id}/art/${art.id}`}>
            <img
                src={art.images[0].baseimageurl}
                alt='artwork from Harvard Art Museum'>
            </img>
        </Link >
    );
}

export default ArtImageTile();
